/////////////////////////////////////////////////////////
//Cuenta de ahorro

//En un inicio el saldo es cero. 

//Ingresar saldo * V1
//Retirar saldo * V1

//Valide si es posible ingresar o retirar valor *

//Guardar mis datos
// Address de cuenta - Nombre, edad, color favorito. * V2


// SPDX-License-Identifier: MIT

/////////////////////////////////////////////////////////
// VERSION 1

/*


pragma solidity ^0.8.0;

contract Ejercicio1CuentaAhorro {

    int saldo;


    function ingresarSaldo (int saldoParaIngresar) public {
        saldo += saldoParaIngresar;
    }

    function retirarSaldo (int saldoParaRetirar) public {
        saldo -= saldoParaRetirar;
    }

    function getSaldo () public view returns (int){
        return saldo;
    }
}
*/

/////////////////////////////////////////////////////////
// VERSION 2


pragma solidity ^0.8.0;

contract Ejercicio1CuentaAhorro {

    struct CuentaAhorro {
        int saldo; 
        string addressCuenta;
        string nombre;
        int edad;
        string colorFavorito;
    }

    CuentaAhorro public c1 = CuentaAhorro(0,"Ivy", "0x5B38Da6a701c568545dCfcB03FcB875f56beddC4", 25 ,"Purpura");


    function ingresarSaldo (int saldoParaIngresar) public {
         require(saldoParaIngresar > 0, "Salso");

        c1.saldo += saldoParaIngresar;
    }

    function retirarSaldo (int saldoParaRetirar) public {
        c1.saldo -= saldoParaRetirar;
    }
}



/////////////////////////////////////////////////////////
// VERSION 3

/*

pragma solidity ^0.8.0;

contract Ejercicio1CuentaAhorro {

    struct CuentaAhorro {
        int saldo; 
        string addressCuenta;
        string nombre;
        int edad;
        string colorFavorito;
    }

    CuentaAhorro public c1 = CuentaAhorro(0,"Ivy", "0x5B38Da6a701c568545dCfcB03FcB875f56beddC4", 25 ,"Purpura");

    mapping (address => CuentaAhorro) public mappingCuentaAhorro;

    function addCuentaAhorro ( string nombre, int edad, string colorFavorito) public {
        mappingCuentaAhorro[msg.sender] = CuentaAhorro(0, nombre, msg.sender, edad, colorFavorito);   
    }


    function ingresarSaldo (int saldoParaIngresar) public {
        c1.saldo += saldoParaIngresar;
    }

    function retirarSaldo (int saldoParaRetirar) public {
        c1.saldo -= saldoParaRetirar;
    }
}
*/

